import React from "react";
import { CommentDiv, DetailContainer, ImageBox, ImageText, ImgDiv, DetailComment } from "./style";

const ContainerForm = () => {
  return (
    <>
      <div>상세페이지</div>

      <DetailContainer>
        <ImgDiv>
          <ImageBox></ImageBox>
          <ImageText></ImageText>
        </ImgDiv>
        <CommentDiv>
          <DetailComment></DetailComment>
          <button>확인</button>
          <button>수정</button>
          <button>삭제</button>
        </CommentDiv>
      </DetailContainer>
    </>
  );
};

export default ContainerForm;
